import React, { PureComponent } from 'react'

class Dog extends PureComponent {
    constructor(props) {
        super(props)

        this.state = {

        }
    }

    render() {
        let dog = this.props.dog
        return (
            <div>
                <h1>{dog.name}</h1>
                <img>{dog.image}</img>
                <p>{dog.breed}</p>
                <p>{dog.age} years old</p>
                <p>{dog.gender}</p>
                <p>{dog.size} </p>
                <p>seller id: {dog.seller_id}</p>

            </div>
        )
    }
}

export default Dog

